      type: "Chat",
      userName: "Obama",
      image: require("../../img/profile_picture/obama.jpg"),
      link: "/chat?name=moi&room=Obama",
      date: "12/03/20",
      key: "4"
  }
]

export default function SignIn() {
    return <ChatList items={CHAT} />
}
